import React from 'react';
import { Link } from '../StyledComponents/StyledComponents';

const InlineLink = (props) => {
    return(
        <Link href={props.route} target={props.external ? '_blank' : null} rel="noopener noreferrer">
        <a>{props.text}</a>
        </Link>
    )
}

export default InlineLink;
